(2,'PASS_RESET_DONE','Password Reset Confirmation','You have Reset your password','<div><p>\r\n    You have successfully reset your password.</p><p>You changed from&nbsp; IP: <b>{{ip}}</b> using <b>{{browser}}</b> on <b>{{operating_system}}&nbsp;</b> on <b>{{time}}</b></p><p><b><br></b></p><p><font color=\"#FF0000\"><b>If you did not changed that, Please contact with us as soon as possible.</b></font><br></p></div>','Your password has been changed successfully','{\"ip\":\"IP of User\",\"browser\":\"Browser of User\",\"operating_system\":\"Operating System of User\",\"time\":\"Request Time\"}',1,1,'2019-09-25 00:04:05','2020-03-07 11:23:47'),
(3,'EVER_CODE','Email Verification','Please verify your email address','<div><br></div><div>Thanks For join with us. <br></div><div>Please use below code to verify your email address.<br></div><div><br></div><div>Your email verification code is:<font size=\"6\"><b> {{code}}</b></font></div>','Your email verification code is: {{code}}','{\"code\":\"Verification code\"}',1,1,'2019-09-25 00:04:05','2021-01-04 00:35:10'),
