/*Table structure for table `ha_estate_listing` */

DROP TABLE IF EXISTS `ha_estate_listing`;

CREATE TABLE `ha_estate_listing` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `PropertyEstate` varchar(20) NOT NULL,
  `PropertyBlock` varchar(20) NOT NULL,
  `PropertyFloor` int(10) NOT NULL,
  `PropertyId` varchar(20) NOT NULL,
  `PropertyName` varchar(255) NOT NULL,
  `PropertyAmount` decimal(10,2) NOT NULL DEFAULT '0.00',
  `MapSnapshot` varchar(300) DEFAULT 'https://via.placeholder.com/1020x1020.png?text=HouseAfrica+Estates',
  `PropertyJson` longtext,
  `PropertyType` smallint(5) NOT NULL DEFAULT '3',
  `PropertyStatus` varchar(50) NOT NULL DEFAULT 'pending',
  `ApplicationStatus` varchar(100) DEFAULT 'PROCESSING',
  `userid` bigint(20) NOT NULL,
  `createdAt` datetime DEFAULT CURRENT_TIMESTAMP,
  `updatedAt` datetime DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=3 DEFAULT CHARSET=latin1;

