DROP TABLE IF EXISTS `ha_messages`;

CREATE TABLE `ha_messages` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `user_to` bigint(11) NOT NULL,
  `user_from` bigint(11) NOT NULL,
  `subject` varchar(100) CHARACTER SET latin1 NOT NULL,
  `message` text CHARACTER SET latin1 NOT NULL,
  `respond` int(11) NOT NULL DEFAULT '0',
  `sender_open` enum('y','n') CHARACTER SET latin1 NOT NULL DEFAULT 'y',
  `receiver_open` enum('y','n') CHARACTER SET latin1 NOT NULL DEFAULT 'n',
  `sender_delete` enum('y','n') CHARACTER SET latin1 NOT NULL DEFAULT 'n',
  `receiver_delete` enum('y','n') CHARACTER SET latin1 NOT NULL DEFAULT 'n',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_bin;

/*Data for the table `ha_messages` */

/*Table structure for table `ha_notifications` */

DROP TABLE IF EXISTS `ha_notifications`;

CREATE TABLE `ha_notifications` (
  `id` bigint(20) NOT NULL,
  `title` varchar(250) NOT NULL,
  `message` text NOT NULL,
  `repeat` int(11) DEFAULT '1',
  `read` int(11) NOT NULL DEFAULT '1',
  `publish_date` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `sender` varchar(255) NOT NULL,
  `receiver` varchar(255) NOT NULL,
  `createdAt` datetime DEFAULT NULL
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

/*Data for the table `ha_notifications` */

/*Table structure for table `ha_offers` */

DROP TABLE IF EXISTS `ha_offers`;

CREATE TABLE `ha_offers` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `name` varchar(50) COLLATE utf8mb4_unicode_ci NOT NULL,
  `discount_type` tinyint(4) NOT NULL COMMENT '1=fixed, 2=percent',
  `amount` double NOT NULL DEFAULT '0',
  `start_date` timestamp NULL DEFAULT NULL,
  `end_date` timestamp NULL DEFAULT NULL,
  `status` tinyint(1) NOT NULL DEFAULT '1' COMMENT '0=disabled, 1=enabled',
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

/*Data for the table `ha_offers` */

/*Table structure for table `ha_offers_products` */

DROP TABLE IF EXISTS `ha_offers_products`;

CREATE TABLE `ha_offers_products` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `offer_id` bigint(20) unsigned NOT NULL,
  `product_id` bigint(20) unsigned NOT NULL,
  PRIMARY KEY (`id`),
  KEY `offers_products_offer_id_foreign` (`offer_id`),
  KEY `offers_products_product_id_foreign` (`product_id`),
  CONSTRAINT `offers_products_offer_id_foreign` FOREIGN KEY (`offer_id`) REFERENCES `ha_offers` (`id`) ON DELETE CASCADE,
  CONSTRAINT `offers_products_product_id_foreign` FOREIGN KEY (`product_id`) REFERENCES `ha_properties` (`id`) ON DELETE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

/*Data for the table `ha_offers_products` */

/*Table structure for table `ha_order_details` */

DROP TABLE IF EXISTS `ha_order_details`;

CREATE TABLE `ha_order_details` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `seller_id` int(11) NOT NULL DEFAULT '0',
  `order_id` int(10) unsigned NOT NULL,
  `product_id` int(10) unsigned NOT NULL,
  `quantity` int(10) unsigned NOT NULL,
  `base_price` decimal(8,2) NOT NULL DEFAULT '0.00',
  `total_price` decimal(8,2) NOT NULL DEFAULT '0.00',
  `details` text COLLATE utf8mb4_unicode_ci NOT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

/*Data for the table `ha_order_details` */

/*Table structure for table `ha_orders` */

DROP TABLE IF EXISTS `ha_orders`;

CREATE TABLE `ha_orders` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `user_id` bigint(20) NOT NULL,
  `user_info` text COLLATE utf8mb4_unicode_ci NOT NULL,
  `order_number` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  `order_details` longtext COLLATE utf8mb4_unicode_ci NOT NULL,
  `order_payment_method` varchar(100) COLLATE utf8mb4_unicode_ci NOT NULL,
  `order_payment_details` mediumtext COLLATE utf8mb4_unicode_ci NOT NULL,
  `order_charge` double(10,2) NOT NULL DEFAULT '0.00',
  `coupon_code` varchar(20) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `coupon_amount` double(10,2) NOT NULL DEFAULT '0.00',
  `total_amount` double(10,2) NOT NULL DEFAULT '0.00',
  `order_type` tinyint(4) NOT NULL DEFAULT '1' COMMENT '1 = Order for self, 2 = order for a guest',
  `payment_status` varchar(100) COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT 'processing' COMMENT '0=Not Paid ,1 = Paid, 2= Cash On Delivery',
  `status` tinyint(4) NOT NULL DEFAULT '0' COMMENT '0 = pending, 1 = processing, 2=dispatched, 3=delivered, 4= canceled_by_admin',
  `created_at` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  `updated_at` datetime DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `orders_order_number_unique` (`order_number`)
) ENGINE=InnoDB AUTO_INCREMENT=8 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

