/*Table structure for table `ha_wallet` */

DROP TABLE IF EXISTS `ha_wallet`;

CREATE TABLE `ha_wallet` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `users_id` bigint(20) unsigned NOT NULL,
  `flag` enum('gate','order-','refunded','deduction-','transfer') NOT NULL COMMENT 'dash indicates a negative value',
  `amount` decimal(14,2) NOT NULL,
  `description` varchar(255) NOT NULL COMMENT 'note',
  `created_at` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `updated_at` datetime DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `users_id` (`users_id`),
  CONSTRAINT `wallet_ibfk_2` FOREIGN KEY (`id`) REFERENCES `ha_users` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `ha_wallet` */

/*Table structure for table `ha_wallet_deposits` */

DROP TABLE IF EXISTS `ha_wallet_deposits`;

CREATE TABLE `ha_wallet_deposits` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `user_id` int(10) unsigned NOT NULL,
  `order_id` int(11) DEFAULT NULL,
  `method_code` int(10) unsigned NOT NULL,
  `amount` decimal(28,8) NOT NULL DEFAULT '0.00000000',
  `method_currency` varchar(40) COLLATE utf8mb4_unicode_ci NOT NULL,
  `charge` decimal(28,8) NOT NULL DEFAULT '0.00000000',
  `rate` decimal(28,8) NOT NULL DEFAULT '0.00000000',
  `final_amo` decimal(28,8) NOT NULL DEFAULT '0.00000000',
  `detail` text COLLATE utf8mb4_unicode_ci,
  `btc_amo` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `btc_wallet` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `trx` varchar(40) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `try` int(10) NOT NULL DEFAULT '0',
  `status` tinyint(1) NOT NULL DEFAULT '0' COMMENT '1=>success, 2=>pending, 3=>cancel',
  `from_api` tinyint(1) NOT NULL DEFAULT '0',
  `admin_feedback` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

/*Data for the table `ha_wallet_deposits` */

/*Table structure for table `ha_wishlists` */

DROP TABLE IF EXISTS `ha_wishlists`;

CREATE TABLE `ha_wishlists` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `PropertyEstate` varchar(20) NOT NULL,
  `PropertyBlock` varchar(20) NOT NULL,
  `PropertyFloor` int(10) NOT NULL,
  `PropertyId` varchar(20) NOT NULL,
  `PropertyName` varchar(255) NOT NULL,
  `PropertyAmount` decimal(10,2) NOT NULL DEFAULT '0.00',
  `MapSnapshot` varchar(300) DEFAULT 'https://via.placeholder.com/1020x1020.png?text=HouseAfrica+Estates',
  `PropertyJson` longtext,
  `PropertyType` smallint(5) NOT NULL DEFAULT '3',
  `PropertyStatus` varchar(50) NOT NULL DEFAULT '1',
  `user_id` bigint(20) NOT NULL,
  `createdAt` datetime DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=latin1;

/*Data for the table `ha_wishlists` */

/*Table structure for table `ha_withdraw_methods` */

DROP TABLE IF EXISTS `ha_withdraw_methods`;

CREATE TABLE `ha_withdraw_methods` (
